import styled from "styled-components";
import { Card } from "@mui/material";

export const TableCard = styled(Card)`
  table {
    thead {
      th {
        color: #7c7c7c;
        font-size: 15px;
        font-weight: 400;
        line-height: 22.5px;
        vertical-align:top;
        .Mui-active {
          color: #7c7c7c;
        }

        input {
          background: #f8f8f8;
          padding:10px 19px !important;
          border-radius: 5px;
          &::before{
            border-bottom: none !important;
          }
        }
      }
    }
    tbody{
      td{
        font-size:13px;
        color:  #606060;
;
      }
    }
  }
`;
